  return (
    <div id="wrapper">
      <div className="card">
        <p>Sign in</p>
      </div>
      <style jsx>{`
        #wrapper {
          display: flex;
          width: 100%;
          height: 100vh;
          background-color: #281742;
          justify-content: center;
          align-items: center;
        }

        .card {
          color: black;
          display: flex;
          border-radius: 4px;
          width: 30%;
          background-color: white;
          height: 100px;
        }
      `}</style>
    </div>
  );
}

Signin.Layout = (props) => <div>{props.children}</div>

export default Signin;
